<!DOCTYPE html>
<html xmlns="http://www.w3.org/1999/xhtml">

<head>
    <title>webpart-server</title>
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />

    <link rel="stylesheet" href="f/fontawesome-free-6.4.0-web/css/all.debug.css" />
    <link rel="stylesheet" href="f/definejs/dist/definejs.debug.css" />
    <link rel="stylesheet" href="f/highlight/styles/default.css" />
    <link rel="stylesheet" href="f/codemirror-5.61.1/lib/codemirror.css" />

    <!--webpart.less.begin-->
    <script>
        [
            'f/codemirror-5.61.1/theme/*.css',
        ]
    </script>
    <!--webpart.less.end-->

  
    

    <!--webpart.less.begin-->
    <script>
        [
            'style/less/@definelib.light.less',
            'style/less/global.less',
            'style/less/editor.less',

            'lib/**/*.less',
            'modules/**/*.less',
            'views/**/*.less',
        ]
    </script>
    <!--webpart.less.end-->

</head>

<body>
    <link rel="html" href="modules/loading/panel.html" />
    <link rel="html" href="modules/markdoc/panel.html" />

    <div data-panel="/Master" style="display: none">
        <link rel="html" href="modules/master/Master/sidebar/panel.html" />
        <div data-panel="/Master/Container" class="container">
            <header>
                <div class="top-tabs">
                    <link rel="html" href="modules/master/Master/page-tabs/panel.html" />
                    <link rel="html" href="modules/master/Master/page-list/panel.html" />
                </div>
            </header>
    
            <div data-panel="/Master/Views" class="main">
                <!--webpart.html.begin-->
                <script>
                [
                    'views/**/view.html',
                ]
                </script>
                <!--webpart.html.end-->
            </div>
        </div>
    </div>

    
    
    
    
    
    <!--webpart.html.begin-->
    <script>
        [
            'lib/**/panel.html',
        ]
    </script>
    <!--webpart.html.end-->

    

   
    <script src="f/jquery/dist/jquery.debug.js"></script>
    <script src="f/definejs/dist/definejs.debug.js"></script>
    <script src="f/highlight/highlight.pack.js"></script>
    <script src="f/marked/marked.mod.debug.js"></script>
    <script src="f/resolve-url/resolve-url.debug.js"></script>
    <script src="f/codemirror-5.61.1/lib/codemirror.js"></script>


    <!--webpart.js.begin-->
    <script>
        [
            'f/codemirror-5.61.1/addon/mode/overlay.js',
            'f/codemirror-5.61.1/addon/selection/active-line.js',
            
            'f/codemirror-5.61.1/mode/htmlmixed/htmlmixed.js',
            'f/codemirror-5.61.1/mode/css/css.js',
            'f/codemirror-5.61.1/mode/javascript/javascript.js',
            'f/codemirror-5.61.1/mode/markdown/markdown.js',
            'f/codemirror-5.61.1/mode/gfm/gfm.js',
        ]
    </script>
    <!--webpart.js.end-->

    
    <!--webpart.js.begin-->
    <script>
        [
            'config/config.base.js',
            'config/**/*.js',
            
            'data/**/*.js',
            'lib/**/*.js',
            'modules/**/*.js',
            'views/**/*.js',
            'routers/**/*.js',
            'index.js',
        ]
    </script>
    <!--webpart.js.end-->

</body>

</html>
